import React from 'react';
export default class Name extends React.Component {
    formatName = (user) => `${user.firstName.toLowerCase()} ${user.lastName.toLowerCase()}`;
    user = {};
    constructor(user) {
        super();
        this.user = user;
    }

    render() {
        console.log(`******* ${this.user}`);
        return <h1>{this.formatName(this.user)}</h1>;
    }
}
